import React from 'react';
import Navbar from './components/Navأar';
import ArticleCard from './components/ArticleCard';
import './App.css';

function App() {
  return (
    <div className="App">
      <Navbar />
      <ArticleCard id="about" title="About">
        <p>I'm Mustafa, a creative web developer with a passion for minimal design and interactivity.</p>
      </ArticleCard>
      <ArticleCard id="projects" title="Projects">
        <p>Here are some cool things I've built using React, hooks, and smooth UI designs.</p>
      </ArticleCard>
      <ArticleCard id="contact" title="Contact">
        <p>Let's connect on GitHub or LinkedIn!</p>
      </ArticleCard>
    </div>
  );
}

export default App;
